// SPDX-License-Identifier: GPL-3.0-only
pragma solidity ^0.8.0;
import "./ERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/Address.sol";

interface IGovernance {
    function stkTokenAddr() external view returns (address);

    function getCalTime() external view returns (uint256);

    function getFundsDownLimit() external view returns (uint256);

    function getZeroTimeLimit() external view returns (uint256);

    function dropProportion() external view returns (uint256);

    function dayLen() external view returns (uint256);
}

interface IPool {
    function getMemberAddrs() external view returns (address[] memory);

    function memberTimes(address _account) external view returns (uint256);

    function balanceOf(address _account) external view returns (uint256);

    function totalSupply() external view returns (uint256);
}

contract Airdrop is ERC20 {
    using SafeMath for uint256;

    IGovernance public Igovern;
    IPool public Ipool;

    //
    uint256 public dropLastTime = 0;
    //lock
    bool private unlocked = true;
    //
    mapping(address => mapping(uint256 => uint256)) public lockInfos;
    //sudo
    address public owner;

    constructor() ERC20("THIS IS A REWARD TOKEN", "retMOVR") {}

    //,_amountWei
    function initialize(
        address _governAddr,
        string memory name_,
        string memory symbol_,
        address _account,
        uint256 _amount,
        address _owner
    ) external {
        require(address(Igovern) == address(0), "Igovern seted!");
        if (_amount > 0) {
            _mint(_account, _amount);
        }
        _name = name_;
        _symbol = symbol_;
        Igovern = IGovernance(_governAddr);
        owner = _owner;
        //constant
        unlocked = true;
    }

    modifier isOwner() {
        require(msg.sender == owner, "Not management!");
        _;
    }

    function setGovernAddr(address _governAddr) public isOwner {
        Igovern = IGovernance(_governAddr);
    }

    modifier lock() {
        require(unlocked, "Airdrop: LOCKED!");
        unlocked = false;
        _;
        unlocked = true;
    }

    //
    function droping(address[] memory _memberAddrs, uint256 _calTime)
        private
        lock
    {
        // uint256 balance = Ipool.balance();
        // uint256 totalSupply = Ipool.totalSupply();
        for (uint256 i = 0; i < _memberAddrs.length; i++) {
            address account = _memberAddrs[i];
            uint256 memberTime = Ipool.memberTimes(account);
            uint256 amount = Ipool.balanceOf(account);
            if (
                !Address.isContract(account) && //
                memberTime > 0 &&
                amount > 0
            ) {
                //_calTime
                uint256 day = (block.timestamp).sub(memberTime).div(
                    60 * 60 * 24
                );
                if (day > 0 && day.mod(_calTime) == 0) {
                    //token
                    // amount = balance.mul(amount).mul(Igovern.dropProportion).div(totalSupply).div(100);
                    //stktoken
                    amount = amount.mul(Igovern.dropProportion()).div(100);
                    _mint(account, amount);
                }
            }
        }
    }

    //
    function startDrop() public {
        //
        require(
            Igovern.stkTokenAddr() != address(0),
            "stkTokenAddr is not set!"
        );
        require(
            (block.timestamp).sub(dropLastTime).div(60 * 60 * 24) > 0,
            "droping!"
        );
        uint256 calTime = Igovern.getCalTime();
        require(calTime > 0, "calTime is zero!");
        Ipool = IPool(Igovern.stkTokenAddr());
        require(
            Ipool.totalSupply() >= Igovern.getFundsDownLimit(),
            "Less then fundsDownLimit!"
        );
        address[] memory memberAddrs = Ipool.getMemberAddrs();
        require(memberAddrs.length > 0, "memberAddrs is zero!");
        dropLastTime = block.timestamp;
        droping(memberAddrs, calTime);
    }

    //,_amountWei
    function burn(address _account, uint256 _amount) public {
        require(_amount > 0, "burn: amount is zero!");
        //
        require(
            Igovern.stkTokenAddr() == msg.sender,
            "burn: msg.sender is illegal!"
        ); //Pool
        _burn(_account, _amount);
    }

    //retToken,_amountWei
    function lockLeaseMargin(
        address _from,
        address _leaseAddr,
        uint256 _leaseDate,
        uint256 _period,
        uint256 _amount
    ) public {
        require(
            Igovern.stkTokenAddr() == msg.sender,
            "lockLeaseMargin: msg.sender is illegal!"
        ); //Pool
        require(_from != address(0), "lockLeaseMargin: _from is illegal!");
        require(
            _leaseAddr != address(0),
            "lockLeaseMargin: _leaseAddr is illegal!"
        );
        require(_period > 0, "lockLeaseMargin: _period is zero!");
        require(_amount > 0, "lockLeaseMargin: _amount is zero!");
        lockInfos[_leaseAddr][_leaseDate] = _period;
        _transfer(_from, _leaseAddr, _amount);
    }

    //retToken,_amountWei
    function unlockLeaseMargin(
        address _account,
        uint256 _leaseDate,
        uint256 _amount
    ) public {
        uint256 period = lockInfos[msg.sender][_leaseDate];
        if (
            period > 0 &&
            _leaseDate.add(period * Igovern.dayLen()) <=
            block.timestamp.div(24 * 60 * 60)
        ) {
            _transfer(msg.sender, _account, _amount);
        }
    }

    //retToken,_amountWei
    function zeroIncomePunish(uint256 _leaseDate, uint256 _amount) public {
        uint256 period = lockInfos[msg.sender][_leaseDate];
        if (
            period > 0 &&
            _leaseDate.add(Igovern.getZeroTimeLimit()) <=
            block.timestamp.div(24 * 60 * 60)
        ) {
            _burn(msg.sender, _amount);
        }
    }
}
